window.bookSummaryJSON = "<p>Angela: My secret is out, and now both Mark and Jack know that I’m a werewolf. Worse, my abusive ex-boyfriend, the one who made me this way, has escaped from prison and he’s after one thing: our son. The Pack is a brutal, criminal motorcycle gang: I don’t want that life for Rabbit. Jack says he can protect us, but the Pack is strong and if they catch us, they’ll kill me and take Rabbit. But if I’m going down, I’m taking Gray with me.</p> <p>Jack: She’s a monster like me, but that doesn’t change how I feel about her. I’ll do everything I can to save her and her son. When old enemies reappear and my Mistress betrays me, I might have to give up everything to protect them from the Pack. Angela’s entrusted me with her son, and I won’t let her down.</p> <p>A werewolf ready to make her last stand.</p> <p>A vampire who will do anything to protect the innocent from the unholy.</p> <p>Welcome to Dark Ink Tattoo, where needles aren't the only things that bite.</p> <p>Dark Ink Tattoo is a scorching paranormal in the vein of Sons of Anarchy, with strong sexual situations and bisexual MCs.</p>"; 
